INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Shrek', 'Shrek, a solitary ogre, is angered when fairy tale creatures are sent to live in his swamp ordered by Lord Farquaad. He befriends a talking donkey named Donkey, and they set off to meet with Farquaad. The lord needs Princess Fiona to marry him so he will become the king of Duloc. When Shrek and Donkey visit him, they are forced to rescue her from an enormous fire-breathing Dragon in exchange for Shrek''s swamp being vacated. The Dragon turns out to be female, and after a minute or two falls in love with Donkey.Donkey, Shrek and Fiona escape, and Dragon chases them. Once Shrek and Donkey rescue Fiona, they take her back to Lord Farquaad. Along the way, Shrek begins to fall in love with Fiona. Donkey finds out from Fiona that she is cursed and turns into an ogre at night. The only way the curse can be broken is by true love''s first kiss. Fiona and Farquaad have a marriage ceremony, but they are interrupted by Shrek, who tells Fiona he loves her.Donkey and Dragon enter, and Dragon eats Farquaad. Shrek and Fiona kiss, and Fiona is permanently turned into an ogre. Shrek gets his swamp back, and the two marry there. After a karaoke party the newlyweds set off on their honeymoon.', 95, 'https://vignette.wikia.nocookie.net/shrek/images/7/7c/Shrek_Poster_02.jpg/revision/latest?cb=20150119045951');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Shrek 2', 'The second film opens with Prince Charming on a quest to rescue Princess Fiona from the Dragon. When he gets there, he finds the wolf from Little Red Riding Hood and The Three Little Pigs in Fiona''s bed. He asks the wolf where Fiona is and the wolf tells him that she is on her honeymoon with Shrek. Once Shrek and Fiona return from their honeymoon, they find Donkey in the swamp who tells them he and Dragon are going through a rough patch. They then get invited to the land of Far Far Away by Fiona''s parents and who want to bless their marriage.When they arrive, Shrek and Fiona are not what they expected. The Fairy Godmother and her son, Prince Charming, are trying to break up Shrek''s marriage by making Fiona fall in love with Prince Charming. However it does not work and Shrek and Fiona stay together. Shrek and Donkey get a new sidekick called Puss in Boots. They have a lengthy quest to search the Fairy Godmother''s cottage to get a love potion. Shrek and Donkey drink the potion and they become something quite unexpected. Shrek becomes human and Donkey becomes a horse. Since Shrek drank the potion, it also affected Fiona as she woke up to seeing her human form once again.At the end of the film, King Harold reverts to a frog after being struck with the Fairy Godmother''s magic, and gives Shrek and Fiona his blessing. After Fiona tells Shrek she loves him just the way he is, they revert to ogres.', 105, 'https://vignette.wikia.nocookie.net/shrek/images/0/0a/Shrek2.jpg/revision/latest?cb=20150119043848');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Shrek the Third', 'Shrek and Fiona are reluctantly reigning over Far, Far Away during King Harold''s prolonged illness. The King promises that if they can find Fiona''s cousin Artie, he will make him the next in line, so both Shrek and Fiona would not have to run the country after his death. As Shrek, Donkey and Puss set off to find Artie, Fiona reveals she is pregnant.Shrek is shocked as he believes he will not be a good father and will ruin his child''s life. This is reinforced by his relationship with his own father, where "he tried to eat me." After finding Artie, Artie is frightened of being king, and they end up on an island where they meet Artie''s former magic teacher, Merlin. Meanwhile, Charming plots to overthrow Artie and become king, but this is foiled by Shrek.The film ends with Shrek and Fiona caring for their newborn ogre triplets.', 93, 'https://vignette.wikia.nocookie.net/shrek/images/2/2f/Shrek3.jpg/revision/latest?cb=20150119044013');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Shrek Forever After', 'Shrek has become a domesticated family man, living happily with Princess Fiona and the triplets. Instead of scaring villagers away like he used to, a reluctant Shrek now agrees to autograph pitchforks. Longing for the days when he felt like a "real ogre", Shrek is tricked into signing a pact with the smooth-talking dealmaker Rumpelstiltskin. He agrees to trade a day from his childhood in exchange for a day to exist as a real ogre again. However, Shrek suddenly finds himself in a twisted, alternate reality where ogres are hunted, Rumplestiltskin is king, Puss is obese, and Shrek has never met Donkey or Fiona. Shrek discovers he unknowingly traded the day he was born and will not exist after the day is over.Shrek becomes entangled with an underground resistance of ogres led by Fiona. Rumpelstiltskin places a bounty on Shrek''s capture, offering the "deal of a lifetime" as a reward. The Pied Piper captures most of the resistance excluding Shrek and Fiona. Shrek, unable to win Fiona''s affection, turns himself in and offers to trade his life to free the captured ogres. The recently released ogres go back to free Shrek and Fiona. As the twenty-four hours are almost up and Shrek lies dying, Fiona kisses him, breaking the deal and reverting everything back to normal. After finding himself back at his triplets'' birthday party where he previously lost his temper and stormed out, he joyfully reunites with family and friends realizing he has everything he ever wanted.', 93, 'https://i.pinimg.com/originals/38/12/94/381294c14aab4be8aeac07448a0efa46.jpg');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Puss in Boots', 'Puss in Boots is an anthropomorphic talking cat, who is named for his signature pair of boots. A fugitive on the run from the law, Puss is seeking to restore his lost honor. He learns that the outlaw couple Jack and Jill have the magic beans he has been looking for most of his life, which can lead him to a giant''s castle. The castle holds valuable golden goose eggs. When Puss tries to steal them from the outlaws'' room, a ruthless hitcat that was hired by Jack and Jill to kill him interrupts, and both fail. The hitcat turns out to be a female cat named Kitty Softpaws and is allied with Humpty Alexander Dumpty, a friendly talking egg and Puss'' long-estranged childhood friend from the orphanage where he was raised. Puss tells Kitty his origin story and of his feelings of betrayal for a youthful misadventure when Humpty tricked Puss into helping commit a bank robbery in his hometown of San Ricardo; Puss has been on the run ever since. Humpty eventually convinces Puss to join them in finding the beans and retrieving the golden eggs.', 96, 'https://vignette.wikia.nocookie.net/shrek/images/e/e7/Puss_in_Boots_poster.jpg/revision/latest?cb=20150119042959');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Shrek the Halls', 'The story begins with Donkey (Eddie Murphy) reminding Shrek (Mike Myers) about Christmas all the time, which bothers him. He soon realizes that his wife Fiona (Cameron Diaz) enjoys celebrating Christmas, so Shrek tries to make one. However, Shrek doesn''t know what Christmas is at first and goes to a bookstore and receives a book titled Christmas for Village Idiots (a parody of the Books for Dummies series). He follows the steps of the book, but everything keeps going wrong when Donkey and the rest of his friends unintentionally wreck Shrek''s swamp. They won''t let Shrek read a story and improvise as they go along, they change his decorations, and ruin Shrek''s supper. They find out about the book, but Shrek kicks them out. Fiona, upset, leaves with the ogre triplets. Shrek tells Donkey and the rest of his friends that he''s sorry for losing his temper. After comforting Shrek in their outhouse, Shrek goes to catch up with the gang to apologize and they learn that Shrek never had a Christmas and doesn''t quite understand it as he never really heard of it before. Shrek then reads a story (rendering of "Twas the Night Before Christmas") to everyone about Ogre Claus, who gives joy and cheer everywhere. They then all see Santa fly by the swamp lighting the moon with ogre ears like Shrek''s; however, Gingy runs back inside screaming as he is terrified of Santa (due to him eating his girlfriend Suzy).', 22, 'https://zombiesinmyblog.com/wp-content/uploads/2013/01/Shrek-the-Halls-v1.jpg');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Scared Shrekless', 'Halloween is Shrek''s favorite holiday, and this year he is planning a night of frights â€” all done ogre-style. Instead of the usual tricks or treats, Shrek challenges Donkey, Puss in Boots and the other fairy tale creatures to spend the night in Lord Farquaad''s abandoned castle of Duloc, while telling scary stories. The last one to be scared "Shrekless" wins, and is crowned King of Halloween.', 24, 'https://m.media-amazon.com/images/M/MV5BNjk5YWQwOGItNDE4NC00MDhjLWFhNmMtMDEzOGM4NDE2ZjRmXkEyXkFqcGdeQXVyNDgyODgxNjE@._V1_.jpg');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Far Far Away Idol', 'When Donkey and Puss are still singing, Shrek and Fiona come walking towards them. Gingy asks if they wanna quit because it''s giving him a headache. Fiona says that they are actually "not that bad". Simon answers that they should take that as a compliment, but says he has seen better. Shrek answers that the competition hasn''t started yet, but Simon replies with that it is just the way he is. Shrek asks if everyone is ready for a competition. The watcher has the option to vote for who they want to win.', 6, 'https://fwcdn.pl/fpo/66/56/206656/7664778.3.jpg');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Donkey''s Christmas Shrektacular', 'This short animation film takes place in the Happy Apple, the friendly version of the Poison Apple. Donkey (Eddie Murphy) suggests everyone sing Christmas carols. Donkey sings "It''s the Most Wonderful Time", Shrek (Mike Myers), Princess Fiona (Cameron Diaz), the Ogre children, and army of ogres sing an ogre version of "Jingle Bells" (containing lyrics such as "Bug Cocoon, Lick the spoon. Try our cricket slurp"). Puss in Boots (Antonio Banderas) sings "Feliz Navidad" in a new rendition titled "Fleas Navidad". In the finale, everyone sings "Jingle Bell Rock", dubbed as "Fairy Tale Rock".', 8, 'https://www.mobygames.com/images/covers/l/490680-donkey-s-christmas-shrektacular-windows-front-cover.png');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Shrek''s Yule Log', 'Shrek''s Yule Log is a 30-minute short released on December 7, 2010, featured on the Donkey''s Christmas Shrektacular DVD.The short takes place inside Shrek''s house, with the fireplace as the only place seen throughout the entire short. Shrek prevents Rumpelstiltskin from dousing the fire, Donkey does the same eye gag (seen from Shrek Forever After), Princess Fiona puts out cookies for Santa, and Puss puts on weight from cookies and cookie dough. Other characters such as Gingy, Pinocchio, the Three Little Pigs, Cookie, the Ogre Triplets, the Dronkeys, and Pied Piper appear.', 29, 'https://image.tmdb.org/t/p/w500/z9EENaDvmHDHXaNdhJYDBTvXuWo.jpg');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Thriller Night', 'The special starts with Shrek (Michael Gough) bursting out of a movie theater angrily, followed by everyone else, including Princess Fiona (Holly Fields), Puss in Boots (AndrÃ© Sogliuzzo), and Donkey (Dean Edwards), who are all fine. Fiona checks if Shrek is all right and he replies that he actually wanted to see something scary because it is Halloween.', 6, 'https://vignette.wikia.nocookie.net/shrek/images/a/a4/Thriller_Night_2011_title_card.png/revision/latest?cb=20120125012455');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'The Pig Who Cried Werewolf', 'The Three Little Pigs are named Heimlich (Sean Bishop), Dieter (Sean Bishop), and Horst (Cody Cameron) are heading home from the hospital where Heimlich got his leg hurt from spying on neighbors, like the Poor Lady and the Shoe and Jack and Jill (not to be confused with the outlaws Jack and Jill). When they arrived at home, Heimlich saw that there''s a new neighbor: The Big Bad Wolf (Aron Warner). When the bag falls down, Heimlich, spying on Big Bad Wolf, saw that Big Bad Wolf has a box of knives, but Dieter and Horst didn''t see it. Big Bad Wolf then buries the knives in the ground and goes into his house.', 6, 'https://m.media-amazon.com/images/M/MV5BMDc5NDAwNzctYzQ2Zi00MDRmLTkxYjYtNzIwMzcwNDc4NWUzXkEyXkFqcGdeQXVyMzY3MDEzMTA@._V1_.jpg');
INSERT INTO movies (create_date, modify_date, title, description, duration, image_path) VALUES(CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, 'Puss in Boots: The Three Diablos', 'After the events of Puss In Boots, Puss is riding his horse through the desert when he is captured by Spanish knights. He is then taken to Princess Alexandra Belagomba, whose "Heart of Fire" Ruby, the crown jewel of her kingdom, is missing. At first, Puss believes he is being wrongfully charged for the theft, but it later turns out that the Princess only wants to hire him based on his reputation. She reveals that a thief called "The Whisperer" stole the heart and that they captured three of his henchmen. The henchmen turn out to be three kittens called the Three Diablos. Though Puss cannot believe that such innocent creatures could be thieves, the princess and her guards are terrified of them. The kittens kindly agree to help Puss on the promise that they will be free if they return the ruby.', 13, 'https://m.media-amazon.com/images/M/MV5BMDM2ZDg1ZmQtYjM0ZC00Yzg3LWE2NmMtNGQwMzUxNTUwMjZmXkEyXkFqcGdeQXVyNjIzODI5OTQ@._V1_.jpg');
